In MongoDB, how do I use a field in the document as input to a $geoWithin/$centerSphere expression?<p>I'm trying to write a MongoDB query that searches for documents within a radius centered on a specified location.</p>

<p>The query below works. It finds all documents that are within <code>searching.radius</code> radians of <code>searching.coordinates</code>. </p>

<p>However what I would like to do is add the current documents <code>allowed_radius</code> value to the <code>searching.radius</code> value, so that the allowed sphere is actually larger.</p>

<p>How can I phrase this query to make this possible?</p>

<p><strong>Present Query</strong>:</p>

<pre><code>collection.aggregate([
        {
            $project:{
                location: "$location",
                allowed_radius: "$allowed_radius"
            }
        },
        {
            $match: {
                $and:
                    [
                        { location: { $geoWithin: { $centerSphere: [ searching.coordinates, searching.radius ] }}},
                        {...},
                    ...]
                ...}
]);
</code></pre>

<p><strong>What I am trying to do (pseudo-query)</strong>:</p>

<pre><code>collection.aggregate([
        {
            $project:{
                location: "$location",
                allowed_radius: "$allowed_radius"
            }
        },
        {
            $match: {
                $and:
                    [
                        { location: { $geoWithin: { $centerSphere: [ searching.coordinates, { $add: [searching.radius, $allowed_radius]} ] }}},
                        {...},
                    ...]
                ...}
]);
</code></pre>

