using express to loop through a mongoose schema function ,collecting data into an array and rendering the page finally with all the data<h3>Nodejs +Express+Mongoose beginner's question:</h3>

<p>*So I came across this problem where I had an array of categories (clothes category). For each category, I wanted to fetch results from the database. So I did what a normal person would do. I used a for loop, fetched the product, stored in an array, then fetched next product, stored in into the same array and so on....... (same process for men and women both ). Now i want to render my view with the data but it isn't accessible coz of the asynchronous nature of node js. I totally understand it. So what I am looking for is an alternative/solution for my problem *</p>

<h3>My express code explains my agony better. Please have a look:</h3>

<pre><code>//INDEX PAGE
router.get('/', (req, res, next) =&gt; { //anonymous callback function
let allCategories;
let womenFashion = [],
    menFashion = [];
Clothing.groupByBodyPart(function(err, categories) {
    if (categories) {
        allCategories = categories.slice(0);
        for (let i = 0; i &lt; allCategories.length; i++) { //looping
            let category = allCategories[i]._id; //gives a category, eg.,footwear,bottomwear
            Clothing.getCategoryWise(category, 'M', function(err, products) { //products here will be an array of objects
                if (products) {
                    menFashion[i] = products.slice(0); //storing products into an array for future use
                    console.log(menFashion[i]); //accessible here one at a time Eg.,[{slippers},{shoes}]
                }
            });
            Clothing.getCategoryWise(category, 'F', function(err, products) {
                if (products) {
                    womenFashion[i] = products.slice(0); //same as above
                    console.log(womenFashion[i]); //same as above
                }
            });
        }
    }
    console.log(menFashion[0]); // not accessible here, so I can't render my page 
    res.render('index.pug', {
        allCategories,
        menFashion,
        womenFashion
    }); //won't work as menFashion and womenFashion aren't available
});
});
</code></pre>

<p><em>Here you go with the mongoose static function:</em></p>

<pre><code>//get categorywise  products
clothingSchema.statics.getCategoryWise = function(bodyPart,gender,callback){
Clothing.aggregate([
  { $match: {'category.bodyPart': bodyPart,
            'category.gender': gender
            }
  },
  { $group: {_id: "$category.type"  }
  },
  { $sort: {_id: 1 }
  }
])
.exec((err,products)=&gt;{
    if(err){
        return callback(err); 
    }else if(!products){
        let err = new Error('No Product Found!');
        err.status = 401;
        return callback(err);
    }
    return callback(null,products);
});
}
</code></pre>

<h3>Just for the record</h3>

<p><em>Everything is working great, I am just having trouble rendering my page because the menFashion and womenFashion array aren't accesible outside the callback.</em></p>

<h3>A thanks in advance :)</h3>

